import React from 'react';
import styled from 'styled-components';

const Upload: React.FC = () => {
    return (
        <>  
            <Button>Upload</Button>
        </>
    );
}

export default Upload;

const Button = styled.button `
    border: none;
    padding: 10px;
`;
